    &quot;comments&quot;: [
      {
        &quot;id&quot;: 1,
        &quot;text&quot;: &quot;Comment 1&quot;,
        &quot;likedBy&quot;: [
          &quot;Tomato&quot;,
          &quot;Potato&quot;
