mongodb & mongoose: How to auto create new collection when saving a document in it<p><strong>Program description:</strong> I have a program that accepts a post request (<code>request</code>) of a &quot;hometask&quot; with its <code>name</code>, <code>description</code>, <code>importance</code> and <code>group</code> parameters provided. I need the provided group parameter to be identified as a collection name in the database (each collection is going to correspond to specific group and so each group will have a collection of hometasks-documents). Each new document should be created with Mongoose schema object.</p>
<p><strong>Problem:</strong> I know that in Python's <code>pymongo</code> when addressing an unexisting collection it's being created automatically, however, in mongoose this turns out not to be the case. I have trouble providing the collection name to the new document-object. When providing <code>{collection: request.group}</code> in a new object in <code>api/hometask.js</code>, the error message started appearing when new requests were made: <strong><code>MongooseError: document must have an _id before saving</code></strong>. I still cannot understand what can be the cause of this problem. I will appreciate any help!</p>
<ul>
<li>Main folder architecture:</li>
</ul>
<p><a href="https://i.stack.imgur.com/HcdHO.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/HcdHO.png" alt="enter image description here" /></a></p>
<ul>
<li>server.js</li>
</ul>
<pre><code>const express = require('express')
require('dotenv').config()
const mongoose = require('mongoose')
const morgan = require('morgan')
const path = require('path')

let app = express();

const port = process.env.PORT || 3000;
mongoose.connect(process.env.uri, { useNewUrlParser: true })
.then(db =&gt; console.log('[ok] connected to db))
.catch(err =&gt; console.error(err))

app.use(express.json())
app.use(express.urlencoded({extended: false}))
app.use(morgan('dev'))
app.use('/api/hometasks', require('./api/hometask'))
app.use('/', express.static(path.join(__dirname, '../dist')))
app.listen(port)
</code></pre>
<ul>
<li>api/hometask.js</li>
</ul>
<pre><code>const express = require('express');
const router = express.Router();

const Record = require('../models/hometask')

router.post('/', async (req, res) =&gt; {
